import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';
import {
    MDBContainer,
    MDBRow,
    MDBCol,
    MDBCard,
    MDBCardBody,
    MDBIcon,
    MDBBtn,
    MDBScrollbar,
    MDBCardFooter,
    MDBCollapse,
  } from "mdb-react-ui-kit";

let email = "mcovarrubias@uc.cl";
let password = "18640729";
const infopay = {
  "type": "JOIN",
  "payload": {
    "authorization": `Basic ${btoa(`${email}:${password}`)}`
  }
}
const redIcon = new L.Icon({
    iconUrl:
      'https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-icon-2x-red.png',
    shadowUrl:
      'https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.7/images/marker-shadow.png',
    iconSize: [25, 41],
    iconAnchor: [12, 41],
    popupAnchor: [1, -34],
    shadowSize: [41, 41],
  });

const pinkIcon = new L.Icon({
    iconUrl:
      'https://www.clker.com/cliparts/d/3/R/P/q/e/hot-pink-home-icon-hi.png',
    iconSize: [25, 25],
    iconAnchor: [12, 25],
    popupAnchor: [1, -34],
    shadowSize: [41, 41],
  });

const motoIcon = new L.Icon({
    iconUrl:
      'https://w7.pngwing.com/pngs/491/336/png-transparent-scooter-vespa-motorcycle-scooter-scooter-motorcycle-piaggio.png',
    iconSize: [25, 25],
    iconAnchor: [12, 25],
    popupAnchor: [1, -34],
    shadowSize: [41, 41],
  });

function Mapa() {
    const [restaurants, setRestaurants] = useState([]);
    const [messages, setMessages] = useState([]);
    const [destinations, setDestinations] = useState([]);
    const [delivery, setDelivery] = useState([]);
    const [position, setPosition] = useState([]);
    const [users, setUsers] = useState([]);
    const [showShow, setShowShow] = useState(false);

  const toggleShow = () => setShowShow(!showShow);


  useEffect(() => {
    // Initialize the UI.

    const socket = new WebSocket("wss://tarea2-2023-1-dev-z2fqxmm2ja-uc.a.run.app/connect"); // replace with your server's URL
    socket.onopen = () => {
      console.log('WebSocket connection established.');
      socket.send(JSON.stringify(infopay));
      socket.addEventListener("message", ({ data })=> {
        const event = JSON.parse(data);
        console.log(event);

        if (event.type === "RESTAURANTS") {
          setRestaurants(event.payload);

        } else if (event.type === "DESTINATIONS") {
          setDestinations(event.payload);
        } else if (event.type === "DELIVERIES") {
          setDelivery(event.payload);
        } else if (event.type === "POSITION") {
          setPosition(event.payload);
        } else if (event.type === "USERS") {
            setUsers(event.payload);
            }
      });
    };

    socket.onmessage = (event) => {
        setMessages([...messages, event.data]);
      };

      socket.onclose = () => {
        console.log("WebSocket closed");
      };

      socket.onerror = (error) => {
        console.error("WebSocket error:", error);
      };

      return () => {
        socket.close();
      };
  }, []); // empty dependency array ensures this effect only runs once

  return (
    <MapContainer center={[-33.35, -70.5]} zoom={13} scrollWheelZoom={true} style={{ height: '600px' }}>
      <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />

      {restaurants.map((restaurant) => (
  // Check if latitude and longitude values are defined before creating marker
  (restaurant.position.lat && restaurant.position.long) &&
  <Marker key={restaurant.id} position={[restaurant.position.lat, restaurant.position.long]} icon={redIcon}>
    <Popup>
      <h3>{restaurant.name}</h3>
    </Popup>
  </Marker>
))}
{delivery.map((deli) => (
    users.map((user) => (
        // Check if latitude and longitude values are defined before creating marker
        position.position.lat && position.position.long && position.delivery_id === deli.id && user.id === deli.user_id &&
        <Marker key={deli.id} position={[position.position.lat, position.position.long]}  icon={motoIcon}>
          <Popup>
            <h3>{user.name}</h3>
          </Popup>
        </Marker>
      ))
))}


{destinations.map((destination) => (
  // Check if latitude and longitude values are defined before creating marker
  (destination.position.lat && destination.position.long) &&
  <Marker key={destination.id} position={[destination.position.lat, destination.position.long]}  icon={pinkIcon}>
    <Popup>
      <h3>{destination.name}</h3>
    </Popup>
  </Marker>
))}
    </MapContainer>
    );
    <MDBContainer fluid className="py-5">
      <MDBRow className="d-flex justify-content-center">
        <MDBCol md="8" lg="6" xl="4">
          <MDBBtn onClick={toggleShow} color="info" size="lg" block>
            <div class="d-flex justify-content-between align-items-center">
              <span>Collapsible Chat App</span>
              <MDBIcon fas icon="chevron-down" />
            </div>
          </MDBBtn>
          <MDBCollapse show={showShow} className="mt-3">
            <MDBCard id="chat4">
              <MDBScrollbar
                suppressScrollX
                style={{ position: "relative", height: "400px" }}
              >
                <MDBCardBody>
                  <div className="d-flex flex-row justify-content-start">
                    <img
                      src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava5-bg.webp"
                      alt="avatar 1"
                      style={{ width: "45px", height: "100%" }}
                    />
                    <div>
                      <p
                        className="small p-2 ms-3 mb-1 rounded-3"
                        style={{ backgroundColor: "#f5f6f7" }}
                      >
                        Hi
                      </p>
                      <p
                        className="small p-2 ms-3 mb-1 rounded-3"
                        style={{ backgroundColor: "#f5f6f7" }}
                      >
                        How are you ...???
                      </p>
                      <p
                        className="small p-2 ms-3 mb-1 rounded-3"
                        style={{ backgroundColor: "#f5f6f7" }}
                      >
                        What are you doing tomorrow? Can we come up a bar?
                      </p>
                      <p className="small ms-3 mb-3 rounded-3 text-muted">
                        23:58
                      </p>
                    </div>
                  </div>

                  <div className="divider d-flex align-items-center mb-4">
                    <p
                      className="text-center mx-3 mb-0"
                      style={{ color: "#a2aab7" }}
                    >
                      Today
                    </p>
                  </div>

                  <div className="d-flex flex-row justify-content-end mb-4 pt-1">
                    <div>
                      <p className="small p-2 me-3 mb-1 text-white rounded-3 bg-info">
                        Hiii, I'm good.
                      </p>
                      <p className="small p-2 me-3 mb-1 text-white rounded-3 bg-info">
                        How are you doing?
                      </p>
                      <p className="small p-2 me-3 mb-1 text-white rounded-3 bg-info">
                        Long time no see! Tomorrow office. will be free on
                        sunday.
                      </p>
                      <p className="small me-3 mb-3 rounded-3 text-muted d-flex justify-content-end">
                        00:06
                      </p>
                    </div>
                    <img
                      src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava2-bg.webp"
                      alt="avatar 1"
                      style={{ width: "45px", height: "100%" }}
                    />
                  </div>

                  <div className="d-flex flex-row justify-content-start mb-4">
                    <img
                      src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava5-bg.webp"
                      alt="avatar 1"
                      style={{ width: "45px", height: "100%" }}
                    />
                    <div>
                      <p
                        className="small p-2 ms-3 mb-1 rounded-3"
                        style={{ backgroundColor: "#f5f6f7" }}
                      >
                        Okay
                      </p>
                      <p
                        className="small p-2 ms-3 mb-1 rounded-3"
                        style={{ backgroundColor: "#f5f6f7" }}
                      >
                        We will go on Sunday?
                      </p>
                      <p className="small ms-3 mb-3 rounded-3 text-muted">
                        00:07
                      </p>
                    </div>
                  </div>

                  <div className="d-flex flex-row justify-content-end mb-4">
                    <div>
                      <p className="small p-2 me-3 mb-1 text-white rounded-3 bg-info">
                        That's awesome!
                      </p>
                      <p className="small p-2 me-3 mb-1 text-white rounded-3 bg-info">
                        I will meet you Sandon Square sharp at 10 AM
                      </p>
                      <p className="small p-2 me-3 mb-1 text-white rounded-3 bg-info">
                        Is that okay?
                      </p>
                      <p className="small me-3 mb-3 rounded-3 text-muted d-flex justify-content-end">
                        00:09
                      </p>
                    </div>
                    <img
                      src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava2-bg.webp"
                      alt="avatar 1"
                      style={{ width: "45px", height: "100%" }}
                    />
                  </div>

                  <div className="d-flex flex-row justify-content-start mb-4">
                    <img
                      src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava5-bg.webp"
                      alt="avatar 1"
                      style={{ width: "45px", height: "100%" }}
                    />
                    <div>
                      <p
                        className="small p-2 ms-3 mb-1 rounded-3"
                        style={{ backgroundColor: "#f5f6f7" }}
                      >
                        Okay i will meet you on Sandon Square
                      </p>
                      <p className="small ms-3 mb-3 rounded-3 text-muted">
                        00:11
                      </p>
                    </div>
                  </div>

                  <div className="d-flex flex-row justify-content-end mb-4">
                    <div>
                      <p className="small p-2 me-3 mb-1 text-white rounded-3 bg-info">
                        Do you have pictures of Matley Marriage?
                      </p>
                      <p className="small me-3 mb-3 rounded-3 text-muted d-flex justify-content-end">
                        00:11
                      </p>
                    </div>
                    <img
                      src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava2-bg.webp"
                      alt="avatar 1"
                      style={{ width: "45px", height: "100%" }}
                    />
                  </div>

                  <div className="d-flex flex-row justify-content-start mb-4">
                    <img
                      src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava5-bg.webp"
                      alt="avatar 1"
                      style={{ width: "45px", height: "100%" }}
                    />
                    <div>
                      <p
                        className="small p-2 ms-3 mb-1 rounded-3"
                        style={{ backgroundColor: "#f5f6f7" }}
                      >
                        Sorry I don't have. i changed my phone.
                      </p>
                      <p className="small ms-3 mb-3 rounded-3 text-muted">
                        00:13
                      </p>
                    </div>
                  </div>

                  <div className="d-flex flex-row justify-content-end">
                    <div>
                      <p className="small p-2 me-3 mb-1 text-white rounded-3 bg-info">
                        Okay then see you on sunday!!
                      </p>
                      <p className="small me-3 mb-3 rounded-3 text-muted d-flex justify-content-end">
                        00:15
                      </p>
                    </div>
                    <img
                      src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava2-bg.webp"
                      alt="avatar 1"
                      style={{ width: "45px", height: "100%" }}
                    />
                  </div>
                </MDBCardBody>
              </MDBScrollbar>
              <MDBCardFooter className="text-muted d-flex justify-content-start align-items-center p-3">
                <img
                  src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava5-bg.webp"
                  alt="avatar 3"
                  style={{ width: "45px", height: "100%" }}
                />
                <input
                  type="text"
                  className="form-control form-control-lg"
                  id="exampleFormControlInput3"
                  placeholder="Type message"
                />
                <a className="ms-1 text-muted" href="#!">
                  <MDBIcon fas icon="paperclip" />
                </a>
                <a className="ms-3 text-muted" href="#!">
                  <MDBIcon fas icon="smile" />
                </a>
                <a className="ms-3 link-info" href="#!">
                  <MDBIcon fas icon="paper-plane" />
                </a>
              </MDBCardFooter>
            </MDBCard>
          </MDBCollapse>
        </MDBCol>
      </MDBRow>
    </MDBContainer>

}

export default Mapa;
